```void shuffleDeck(Deck* theDeck)
{
    int n = NUM_OF_CARDS_IN_DECK;

    if (n > 1)
    {
        unsigned int i;
        for (i = 0; i < n - 1; i++)
        {
            unsigned int j = i + rand() / (RAND_MAX / (n - i) + 1);
            Card t = theDeck->cards[j];
            theDeck->cards[j] = theDeck->cards[i];
            theDeck->cards[i] = t;
        }
    }
}```

