```int List::remove(int val)
{
    Ex3Node* temp; 
    Ex3Node* current;
    Ex3Node* after;

    int removeCount = 0;

    if (head == NULL)
    {
        return 0;
    }

    while (head->data == val)
    {
        temp = head;
        head = head->next;
        delete temp;

        removeCount++;
    }

    current = head;
    after = current->next;

    while (after != NULL)
    {
        if (after->data == val)
        {
            current->next = after->next;
            delete after;
            after = current->next;

            removeCount++;
        }

        else
        {
            current = current->next;
            after = after->next;
        }
    }

    return removeCount;
}```

