//QUESTION 5
// PARAM: arr is array to be sorted, n is size of array, i should initially = 0
int ssort(int arr[], int n, int i)
{  
    int operationCount = 0;

    if (i < n-1) {

        // Find and swap smallest remaining
        int next = i + 1;
        operationCount++;

        int smallest = i;
        operationCount++;

        while (next < n) {
            operationCount++;

            if (arr[next] < arr[smallest]) {

                smallest = next;
                operationCount++;
            }
            operationCount++;

            next++;
            operationCount++;
        }
        operationCount++;

        // Swap i with smallest
        int temp = arr[i];
        operationCount++;

        arr[i] = arr[smallest];
        operationCount++;

        arr[smallest] = temp;
        operationCount++;

        operationCount = operationCount + ssort(arr, n, i + 1);
    }
    operationCount++;

    return operationCount;
}

