int pattern(int n, int i)
{
    int operationCount = 0;

    if (n > 0) {
        operationCount = operationCount + pattern(n/2, i);
        // Print i spaces
        cout << string(i, ' '); // NOTE: counts as ONE operation
        operationCount++;

        // A loop to print n asterisks, each one followed by a space
        int ast = 0;
        operationCount++;

        while (ast < n) {
            operationCount++;

            cout << "* ";
            operationCount++;

            ast++;
            operationCount++;
        }
        operationCount++;

        cout << endl;
        operationCount++;

        i += n;
        operationCount++;

        operationCount = operationCount + pattern(n / 2, i);

    }
    operationCount++;

    return operationCount;
}```

```int ssort(int arr[], int n, int i)
{
    int ops = 0;

    if (i < n - 1) {
        // Find and swap smallest remaining
        int next = i + 1;
        int smallest = i;

        while (next < n) {
            if (arr[next] < arr[smallest]) {
                smallest = next;
                ops++;
            }
            next++;
            ops += 3;
        }

        // Swap i with smallest
        int temp = arr[i];
        arr[i] = arr[smallest];
        arr[smallest] = temp;
        ops += 6;
        ops = ops + ssort(arr, n, i + 1);
    }
    ops++;
    return ops;
}```

