```template<class T>
NodeT<T>* RedBlackTree<T>::bstInsert(T data){           

    NodeT<T>* newNode = new NodeT<T>(data); 

    if (root == nullptr){
        root = newNode; 
    }

    else{
        NodeT<T>* parent = root; 
        NodeT<T>* next = root; 

        while (next != nullptr){
            parent = next; 
            if (data < parent -> data){
                next = parent -> left; 
            }
            else{
                next = parent -> right; 
            }
        }

        if (data < parent -> data){
            parent -> left = newNode; 
            newNode -> parent = parent; 
        }
        else{
            parent -> right = newNode; 
            newNode -> parent = parent; 
        }
    }
    return newNode; 
}

template<class T>
void RedBlackTree<T>::left_rotate(NodeT<T>* node){             
    NodeT<T> *child = node->right; 
    node -> right = child -> left; 

    if(child -> left != nullptr){
        child -> left -> parent = node; 
    }
    child -> parent = node -> parent; 

    if(node -> parent == nullptr){
        root = child; 
    }
    else if(node == node -> parent -> left){
        node -> parent -> left = child; 
    }
    else{
        node -> parent -> right = child; 
    }

    child -> left = node; 
    node -> parent = child; 
}

template<class T>
void RedBlackTree<T>::right_rotate(NodeT<T>* node){
    NodeT<T> *child = node->left; 
    node -> left = child -> right; 

    if(child -> right != nullptr){
        child -> right -> parent = node; 
    }
    child -> parent = node -> parent; 

    if(node -> parent == nullptr){
        root = child; 
    }
    else if(node == node -> parent -> right){
        node -> parent -> right = child; 
    }
    else{
        node -> parent -> left = child; 
    }

    child -> right = node; 
    node -> parent = child;
}```

